import React from 'react';
import { Container, Nav, Navbar, NavDropdown, Button } from 'react-bootstrap';
import bloodNavbar from '../assets/images/logo.png';
import './Navbar.css';
import { Link, useNavigate } from 'react-router-dom';

const navStyles = {
  navLink: {
    color: '#333 !important',
    fontWeight: 500,
    transition: 'all 0.3s ease',
    position: 'relative',
    textDecoration: 'none'
  },
  navLinkAfter: {
    content: '""',
    position: 'absolute',
    bottom: 0,
    left: 0,
    width: '100%',
    height: '2px',
    backgroundColor: '#46052d',
    transform: 'scaleX(0)',
    transition: 'transform 0.3s ease'
  },
  navLinkHover: {
    color: '#46052d !important',
    textDecoration: 'none',
    '&::after': {
      transform: 'scaleX(1)'
    }
  },
  navLinkActive: {
    color: '#46052d !important',
    textDecoration: 'underline',
    textUnderlineOffset: '4px',
    textDecorationThickness: '2px'
  },
  dropdownItem: {
    color: '#333',
    transition: 'all 0.3s ease',
    '&:hover': {
      backgroundColor: '#46052d',
      color: 'white'
    }
  },
  button: {
    borderRadius: '4px',
    padding: '0.5rem 1.5rem'
  }
};

function NavigationBar() {
  const navigate = useNavigate();
  const isAuthenticated = localStorage.getItem('userId');
  const userType = localStorage.getItem('userType');

  const handleLogout = () => {
    localStorage.removeItem('userId');
    localStorage.removeItem('userType');
    navigate('/login');
  };

  return (
    <Navbar bg="light" expand="lg" className="shadow-sm">
      <Container>
        <Navbar.Brand as={Link} to="/">
          <img
            src={bloodNavbar}
            alt="Gota de sangue"
            className="img-fluid"
            style={{ 
              maxWidth: '50px',
              filter: 'brightness(2) contrast(1.5) saturate(1.2)'
            }}
          />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav" className="justify-content-end">
          <Nav className="align-items-start">
            <Nav.Link 
              as={Link} 
              to="/" 
              className="mx-2"
              style={{
                ...navStyles.navLink,
                '&:hover': navStyles.navLinkHover,
                '&.active': navStyles.navLinkActive
              }}
            >
              Home
            </Nav.Link>
            <Nav.Link 
              as={Link} 
              to="/sobre" 
              className="mx-2"
              style={{
                ...navStyles.navLink,
                '&:hover': navStyles.navLinkHover,
                '&.active': navStyles.navLinkActive
              }}
            >
              Sobre n√≥s
            </Nav.Link>
            <Nav.Link 
              as={Link} 
              to="/necessidades" 
              className="mx-2"
              style={{
                ...navStyles.navLink,
                '&:hover': navStyles.navLinkHover,
                '&.active': navStyles.navLinkActive
              }}
            >
              Encontrar Sangue
            </Nav.Link>
            {userType === 'banco' && (
              <Nav.Link 
                as={Link} 
                to="/gerenciar-necessidades" 
                className="mx-2"
                style={{
                  ...navStyles.navLink,
                  '&:hover': navStyles.navLinkHover,
                  '&.active': navStyles.navLinkActive
                }}
              >
                Gerenciar Necessidades
              </Nav.Link>
            )}
            <NavDropdown 
              title="Cadastre-se" 
              id="basic-nav-dropdown" 
              className="mx-2"
            >
              <NavDropdown.Item 
                as={Link} 
                to="/cadastro/doador"
                style={navStyles.dropdownItem}
              >
                Seja um doador
              </NavDropdown.Item>
              <NavDropdown.Item 
                as={Link} 
                to="/cadastro/banco"
                style={navStyles.dropdownItem}
              >
                Cadastrar banco
              </NavDropdown.Item>
            </NavDropdown>
            {!isAuthenticated ? (
              <Button 
                variant="outline-dark" 
                as={Link} 
                to="/login" 
                className="mx-2 px-4"
                style={navStyles.button}
              >
                Entrar
              </Button>
            ) : (
              <Button 
                variant="outline-danger" 
                onClick={handleLogout}
                className="mx-2 px-4"
                style={navStyles.button}
              >
                Sair
              </Button>
            )}
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavigationBar;
